import React from 'react';
import './ExRoutes.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTruck, faEuroSign } from '@fortawesome/free-solid-svg-icons';

export default function ExRoutes() {
    return (
        <>
            <div className='ex-routes-container'>
                <div className='route'>
                    <table>
                        <thead>
                            <tr>
                                <th>Tratta</th>
                                <th>Mezzo</th>
                                <th>Costo</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Milano - Roma</td>
                                <td> Telonato <FontAwesomeIcon icon={faTruck} className="icon" /></td>
                                <td>50 bacini</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        </>
    );
};
